    getPhp = ()=> {
        let db;
        fetch('http://localhost/craft/api/books.php ', {
            method: 'POST',
            headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json'
            },
            body: JSON.stringify({
            })
        }).then(res => res.json()).then(json =>{
            json.map(el => {
                db=JSON.parse(el);
            });
        })

